  const unsubscribeFromSnapshot = null;
  useEffect(() => {
    const collectionRef = collection(db, 'collections');
    onSnapshot(collectionRef, (snapshot) => {
      console.log({ snapshot });
    });
  }, []);
  return (
    <div className='shop-page'>
      <Outlet />
    </div>
  );
};

export default ShopPage;
